import React, { useState } from "react";
import RoomCard from "./RoomCard";
import "./RoomListCard.css";
import backIcon from "../../image/back.png";
import nextIcon from "../../image/next.png";

export default function RoomListCard({ RoomList }) {
  return (
    <div style={{ display: "flex", justifyContent: "space-between" }}>
      <button style={{ width: "5%", backgroundColor: "white" }}>
        <img src={backIcon} alt="backIcon" style={{ width: "20px" }} />
      </button>
      <div className="roomListContainer">
        <RoomCard item={RoomList[0]} />
        <RoomCard item={RoomList[1]} />
        <RoomCard item={RoomList[2]} />
        <RoomCard item={RoomList[3]} />
      </div>
      <button style={{ width: "5%" }}>
        <img src={nextIcon} alt="nextIcon" style={{ width: "20px" }} />
      </button>
    </div>
  );
}
